wet = [{
    nilai: 7,
    detail: 'Jika seseorang memiliki jumlah neptu 7, maka orang tersebut memiliki watak senang bepergian jauh untuk berlibur atau bekerja. Orang dengan jumlah neptu 7 memiliki sebutan Pendito Kang Lelaku.'
}, {
    nilai: 8,
    detail: 'Jika seseorang memiliki jumlah neptu 8 orang tersebut suka memendam sesuatu. Seorang dengan neptu 8 bagaikan bara api yang awalnya kecil namun kelak bisa membakar manusia lainnya, dengan seperti itu orang dengan neptu 8 memiliki sebutan Lakune Geni.'
}, {
    nilai: 9,
    detail: 'Jika seseorang memiliki jumlah neptu 9 maka dirinya memiliki karakter yang mudah dipengaruhi oleh orang lain dan tidak memiliki pendirian hidup yang tetap. Hal tersebut membuat orang berneptu 9 mendapatkan julukan Lakune Angin.'
}, {
    nilai: 10,
    detail: 'Jika seseorang memiliki jumlah neptu 10 maka ia memiliki watak suka menasehati namun tidak mau menerima saran dari orang lain. Orang dengan jumlah neptu 10 memiliki julukan Pendito Mbangun Teki.'
}, {
    nilai: 11,
    detail: 'Jika seseorang memiliki jumlah neptu 11 maka ia memiliki watak yang tidak dapat dijadikan pemimpin karena plin plan tidak memiliki pendirian dan tidak memiliki jiwa kepemimpinan. Orang dengan neptu 11 dijuluki dengan Lakune Setan.'
}, {
    nilai: 12,
    detail: 'Watak seseorang dengan neptu 12 adalah suka mengalah dan suka menebarkan kedamaian kepada orang lain sehingga ia dijuluki Lakune Kembang.'
}, {
    nilai: 13,
    detail: 'Orang dengan neptu 13 memiliki pesona yang luar biasa namun tidak dapat dijadikan pemimpin. Kharisma yang ia miliki tidak sepadan dengan rendahnya kemampuan memimpinnya. Orang yang memiliki hari lahir dengan jumlah neptu 13 dijuluki dengan Lakune Lintang.'
}, {
    nilai: 14,
    detail: 'Watak orang berneptu 14 adalah dapat menjadi pencerah bagi orang banyak. Dialah tempat mencari solusi saat beragam masalah tiba sehingga ia dijuluki dengan watak Lakune Mbulan.'
}, {
    nilai: 15,
    detail: 'Jika seseorang memiliki jumlah neptu 15 maka ia memiliki watak yang mudah marah dan mudah dendam pada orang lain sehingga wataknya dijuluki Lakune Geni.'
}, {
    nilai: 16,
    detail: 'Orang dengan hari lahir berjumlah neptu 16 memiliki watak yang mudah diatur dan suka mengayomi. Ia memiliki karakter yang sangat baik untuk dijadikan pemimpin sehingga wataknya dijuluki Lakune Bumi.'
}, {
    nilai: 17,
    detail: 'Watak orang dengan jumlah neptu 17 memiliki sifat mudah diatur jika bisa meraih hatinya. Menghadapi manusia seperti ini harus hati-hati karena moody sehingga dijuluki dengan watak Lakune Gunung.'
}, {
    nilai: 18,
    detail: 'Jumlah neptu 18 adalah jumlah neptu tertinggi. Seseorang yang memiliki jumlah neptu 18 memiliki watak yang mendominasi pada kekuasaan dengan segala permintaannya harus dipenuhi bahkan dengan berbagai cara. Watak seperti ini dijuluki dengan Lakune Paripurna.'
}]
