wukusifat = [
    {Sinta: "Sanghyang Batara Yamadipati = wataknya seperti raja dan pendita,  banyak kemauan, keras, cepat bahagia, bakat kaya harta benda. Memanggul tunggul = mudah mendapatkan kesenangan hidup. Kaki belakang direndam dalam air = perintahnya panas didepan dingin belakang. Pohonnya : Kendayakan = jadi pelindung orang susah, dan orang minggat.Burungnya : Gagak = mengerti petunjuk gaib. Gedungnya didepan = memperlihatkan simbul kekayaannya, pradah hanya lahir. Bahayanya : Berada di pertengahan  umur. Tangkalnya : selamatan nasi pulen beras sepitrah dikukus, lauknya daging kerbau seharga 21 keteng dimasak pindang, membelinya tidak menawar. Selawatnya 4 keteng. Doanya : Tolak bilahi. Candranya : Endra = gemar bertapa brata, angkuh, suka kepada kepanditan. Ketika kala wuku berada ditimu laut, selama 7 hari tak boleh mendatangi tempat kala."},
    {Landep: "Sanghyang Batara Mahadewa = bagus rupanya, terang hatinya, gemar bersemadi. Kakinya direndam dalam air  = perintahnya keras didepan dingin dibelakang, kasih sayang. Pohonnya : Kendajakan = jadi pelindung orang sakit, orang sengsara dan orang minggat. Burungnya : Atatkembang = jadi kesukaan para agung, jika menghambakan diri jadi kesayangan. Gedungnya didepan = memperlihatkan kekayaannya, pradah hanya lahir.Bahayannya : korobohan pohon. Tangkalnya : Selamatan tumpeng beras sepitrah dikukus. Lauknya daging rusa dicacah lalu dibakar. Selawatnya 4 keteng. Doanya : Kabul. Candranya : Surating raditya = tajam ingatannya, dapat mengerjakan segala pekerjaan, dapat menggrirangkan hati orang lain."},
    {Wukir: "Sanghyang Batara Mahayekti = besar hatinya, menghendaki lebih dari sesama. Tunggalnya : didepan = akhirnya hidup senang. Menghadapi air di jembung besar = baik budi pekertinya. Pohonnya : Nagasari = bagus rupaya, sopan-santun, jika bekerja dicintai oleh majikannya. Burungnya : Manyar = tak mau kalah dengan sesama, dapat mengerjakan segala pekerjaan. Gedungnya didepan = memperlihatkan kekayaannya, pradah hanya lahir. Bahayanya : dianiaya.Penangkalnya : selamatan nasi uli, beras sepritah dikukus, daging ayam ayam putih dimasak pakai santan dan sayur lima macam. Selawatnya 4 keteng. Doanya rajukna. Candranya : Gunung artinya jika didekati sulit dan berbahaya jika dilihat dari jauh menyedapkan pemandangan. Ketika kolo wuku berada ditenggara, dalam 7 hari tidak boleh mendatangi tempat kolo."},
    {Kurantil: "Sanghyang Batara Langsur = pemarah. Memanggul tunggal = akhirnya mendapat kesenangan hidup. Air dalam jimbung besar disebelah kiri = serong hatinya. Pohonnya : Ingas = tak dapat untuk berlindung, karena panas. Burungnya : Salinditan = tangkas. Gedungnya terbalik didepan = murah hati. Bahayanya : jatuh memanjat.Penangkalnya : selamatan tumpeng beras sepitrah dikukus, lauknya daging ayam lereng dipecal. Selawatnya 7 keteng. Doanya : rajukna dan pina. Candranya : Woh-wohan = tak tentu rejekinya.Ketika kolo wuku berada dibawah, dalam 7 hari tak boleh turun dari gunung dan tak boleh menggali tanah."},
    {Tolu: "Sanghyang Batara Bayu = dapat menyenangkan hati orang lain, kalau marah berbahaya, tak dapat dicegah, Tunggulnya : dibelakang = kebahagiannya terdapat dibelakang hari. Pohonnya : Wijayamulya = sangat indah rupanya, tajam roman mukanya, tinggi adat-istiadatnya, teliti, suka pada kesunyian, selamat hatinya. Burungnya : Branjangan = riang tangan, cepat bekerjanya. Gedungnya didepan = suka memperlihatkan kekayaannya, pradah hanya lahir. Bahayanya = ditanduk atau disiung.Penangkalnya : selamatan nasi uduk beras sepitrah dikukus, lauknya daging ayam dimasak dengan santan. Selawatnya 3 keteng. Doanya : Kabul. Candranya : Wangkawa = angkuh, tidak tetap, suka bohong.Ketika kolo wuku berada dibarat-laut, dalam 7 hari tak boleh mendatangi tempat kala."},
    {Gumbreg: "Sanghyang Batara cakra = keras budinya, segala yang dikehendakinya segera tercapai, tak mau dicegah, pengasih. Kakai sebelah yang didepan direndam dalam air = perintahnya dingin didepan, panas dibelakang. Pohonnya : beringin = jadi pelindung keluarganya, budinya tinggi. Burungnya : ayam hutan = liar, dicintai oleh para agung, suka tinggal ditempat sunyi. Gedungnya dikirikan = penyayang, jika marah taka sayang kepada harta bendanya.Bahayanya : tenggelam atau kejatuhan dalam. Tangkalnya : selametan nasi pulen beras sepitrah dikukus, lauknya daging ayam berumbun yang masih muda dan daun-daun 9 macam. Selawatnya 4 keteng. Doanya : Rajukna. Candranya : Geter nekger ing wijati = hening pikirannya, perkataannya nyata redhoan.Ketika “kala wuku” berada di Selatan menghadap utara, dalam 7 hari tidak boleh memandang wajah kala."},
    {Warigalit: "Sanghyang Batara asmara = bagus rupanya,senang asmara, cemburuan, hatinya mudah tersentuh, Pohonnya : sulastri = bagus rupanya, banyak yang cinta. Burungnya : kepodong – cemburuan, tak suka berkumpul dengan orang banyak. Bahayanya : tersangkut suatu perkara.Tangkalnya : selametan nasi urap beras sepitrah dikukus, lauknya daging kerbau ranjapan (pembelian bersama-sama), dimasak getjok. Selawatnya 8 keteng. Doanya : tolak bilahi. Candranya : kaju kemladean ngajak sempal = dimana-mana dapat tumbuh. Ketika “kala wuku” berada diatas, dalam 7 hari tidak boleh mendatangani tempat kala"},
    {Warigagung: "sanghyang mahajekti = berat tanggungannya, berkeinginan. Tunggulnya : dibelakang – rejekinya dibelakang hari. Pohonnya : cemara = rame bicaranya, lemah lembut perintahnya dan dihormati. Burungnya : betet = keras kemauannya, pandai mencari kehidupan. Gedungnya dua buah dibelakang  dan didepan = ichlasnya hanya setengah. Bahayanya : dimarahi temannya.Penangkalnya : selamatan nasi uduk bers sepitrah dikukus, lauknya daging bebek dimasak gurih dan daun-daunan 5 macam. Selawatnya 5 keteng. Doanya : rasul. Candranya : Ketug lindu = menepati perkataannya, jika marah menakutkan, tidak mau menerima takdir. Ketika “kala wuku” berada di utara menghadap ke selatan, dalam 7 hari tidak boleh mendatangani tempat kala."},
    {Julungwangi: "sanghyang sambu = tinggi perasaannya, tidak boleh disamai. Mengahadap air dijembung = pradah ikhlasan, akan tetapi harus diperlihatkan harum = dicintai oleh orang banyak. Burungnya kutilang = banyak bicara dan perkataannya dipercayai orang, dicintai para pembesar.Bahayanya : diterkam harimau. Tangkalnya : selamatan nasi pulen beras sepitrah dikukus, lauknya daging ayam brumbun dan uang suwang (+/- 81 ½ sen). Selawatnya : kucing. Doanya Tolak bilahi. Candranya : kasturi arum angambar = segala kehendaknya belum terjadi telah tersiar banyak yang cinta."},
    {Sungsang: "sanghyang gana = pemaranh, gelap hati. Air dijebung didepannya +/- pradah, ikhlasan, harus diperlihatkan pemberiannya, banyak rejekinya. Pohonnya : tanganan = tak suka menganggur, keras budinya, suka kepada kepunyaan orang lain. Burungnya : nori = pemboros, jauh kebahagiaannya, murka. Gedungnya terbalik dibelakang = ikhlasan dengan tidak pakai perhitungan.Bahayanya : kena besi. Tangkalnya : selamatan nasi megana dan tumpeng betas 2 pitrah, daun-daunan 9 macam dicampur dalam tumpeng. Selawatnya 10 keteng. Doanya : Kabul. Candranya : sekar wora-wari bang = besar amarahnya, tetapi mudah dicegah. Ketika “kala wuku” berada di timur dalam 7 hari tidak boleh mendatangani tempat kala."},
    {Galungan: "Sanghyang Batara Komajaya = teguh hatinya, dapat melegakan hati orang susah, cinta pada perbuatan baik, jauh kepada perbuatan jahat. Memangku air dalam bokor =suka bersedekah, pengasih, namun sedikit rejekinya. Pohonnya : Tanganan  = ringan tangan, keras budinya, gampang suka pada kepunyaan orang lain. Burungnya : Bido = besar nafsunya, murka.Bahayanya : berselisih.Penangkalnya : selamatan nasi beras sepitrah dikukus, lauknya daging kambing. Doanya : Selamat pina. Candranya : peksi wonten ing luhur = jika mencari hasil dengan menundukkan kepala, sebab gora-goda. Ketika kolo wuku berada di selatan daya, dalam 7 hari tak boleh mendatangi tempat kala."},
    {Kuningan: "Sanghyang Batara Indra = melebihi sesama, tinggi derajatnya. Pohonnya : Wijayakusuma = rupanya sangat indah, sangat puaka, tinggi budinya dan teliti, menghindari keramaian, selamat hatinya. Burungnya : Urang-urangan = cepat bekerjanya, lekas marah, pemalu.Gedungnya dibelakang, jendelanya tertutup = hemat. Bahayanya = diamuk..Penangkalnya : selamatan nasi punar beras sepitrah dikukus, lauknya daging kerbau membelinya beramai-ramai, digoreng. Selawatnya 11 keteng. Doanya : Kabul. Candranya : Garojogan = rame bicaranya, banyak bohong.Ketika kolo wuku berada di Barat, dalam 7 hari tak boleh mendatangi tempat kala"},
    {Langkir: "Sanghyang Batara Kala menggigit bahunya sendiri = besar nafsunya, tidak sayang kepada badannya sendiri, yang melihat takut, buruk adat-istiadatnya, tidak mau menurut, murka, banyak larangan. Pohonnya : Ingas dan cemara tumbang = panas hati, tak boleh didekati orang.Penangkalnya : selamatan nasi uduk beras sepitrah dikukus, lauknyadaging kambing dan ikan dimasak pakai santan, sayuran secukupnya. Selawatnya 5 keteng. Doanya : Slametpina. Candranya : Redi gumaludug = bicaranya menakutkan, tetapi tidak mengapa.Ketika kolo wuku berada di selatan daya, dalam 7 hari tak boleh mendatangi tempat kala."},
    {Mandasia: "Sanghyang Batara Brama, kuat budinya, pemaran, tak mau memberi ampun, jika marah tak dapat dicegah, tegaan. Pohonnya : Asam = kuat dan dicintai orang banyak, jadi pelindung sengsara. Burungnya : Platukbawang = kuat budinya, cepat pekerjaannya, tidak sabaran. Gedungnya terguling didepan = hemat dan banyak rejekinya. Bahayanya : Kena api dan dijahili orang.Penangkalnya : selamatan nasi merah beras sepitrah dikukus, sayur bayam merah, daging ayam merah dipindang dan bunga setaman yang merah. Selawatnya uang baru 40 keteng. Doanya : Slamat. Candranya : Watu item munggeng papreman lan wreksa gung lebet tancepnya = sabar, tetapi jika marah kejam.Ketika kolo wuku berada diatas, dalam 7 hari tak boleh mendatangi tempat kala."},
    {Djulungpujut: "Sanghyang Batara guretno, = suka kepada keramaian, tersiar baik, mempunyai kedudukan yang lumayan. Menghendaki bukit = besar kemaunnya, tak suka diatasi, menghendaki memerintah. Pohonnya : Rembuknya = indah warnanya, tidak berbau, dimana-mana jadi kunjungan orang. Burung : Prijohan = besar kemauannya, halus budinya. Bahayanya : diteluhPenangkalnya : selamatan tumpeng beras sepitrah dikukus, daging ayam merah dipanggang, daun- daunan 9 macam.Selawatnya 30 keteng. Doanya : Balasrewu dan Kunut. Candranya : Palwa ing samodra = kesana-kemari mencari nafkah, rejekinya tidak kurang.Ketika kolo wuku, berada di utara dan selatan, dalam 7 hari tak boleh mendatangi tempat kala."},
    {Pahang: "Sanghyang Batara tantra = perkataannya melebihi sesama, tidak sabaran menepati janji. Jembungnya disebelah kiri dibelakangnya = suka jalan serong. Memanggul senjata tajam = waspada, kasar perkataannya, panas hati, suka bertikai. Pohonya : Kendayaan = jadi pelindung orang sakit, orang sengsara dan orang minggat. Burung : Cocak = gelatak bicaranya. Gedung telentang = boros.Bahayanya : dianiaya.Penangkalnya : selamatan nasi uduk beras sepitrah, lauknya daging ayam dimasak sansan, daun-daunan 11 macem. Selawatnya 9 keteng. Doanya : Rasul.Candranya : Pulo katinggal saking tebih = tersiar semua tingkah lakunya, lahirnya suci, batinnya kotor, angkuh, selalu susah.Ketika kolo wuku berada di Barat-Laut dalam 7 hari tak boleh mengunjungi tempat kala."},
    {Kuruwelut: "sanhyang wisnu : tajam ciptanya, tinggi dan selamat budinya, melebihi sesama dewa. Memanggul : cakra = tajam hatinya, berhati-hati. Pohonnya : parijata = jadi pelindung dan besar kebahagiaannya. Burungnya : puter = jika berbicara mula-mula kalah, akhirnya menang, tidak pernah bohong, tidak suka terhadap perkataan yang remeh. Gedungnya didepan = memperlihatkan kekayaannya, puaka tak dapat dipermudah.Bahayanya : kena racun daun. Tangkalnya : selamatan bermacam-macam sayuran, jajan pasar, sekar boreh, tindihnya uang lama sebaranDoanya : tawil. Candranya : tirta wening = sedikit bicaranya, suci hatinya, diturut perintahnya, jadi tempat pengungsian. Ketika “kala wuku” berada diatas, dalam 7 hari tidak boleh mendatangitempat kala."},
    {Mrakeh: "sangsyang surenggana = tawakal hatinya, agak ingatan, berkesanggupan, berani kepada kesulitan. Tunggulnya membalik = lekas hidup senang. Pohonnya : Trengguli = buahnya tidak berguna. Tak mempunyai burung = tak boleh disuruh jauh, tentu mendapat bahaya. Gedungnya dipanggul = memperlihatkan pemberian. Bahayanya : tenggelam.Tangkalnya : selamatan nasi uduk, daging ayam mulus dimasak dengan santan dan bermacam-macam ketan. Selawatnya 100 keteng.Doanya : tolak bilahi. Candranya : pandam ageng amerapit = tawakal, mempunyai hati kasihan kepada orang miskin. Ketika “kala wuku” berada di utara, dalam 7 hari tak boleh mendatangi tempat kala."},
    {Tambir: "sanghyang siwa = lahir dan batinnya terkadang berlainan. Pohonnya : Upas = bukan tempat perlindungan, tajam perkataannya. Burungnya : prenjak = tahu petunjuk gaib, suka membuat perkabaran yang mengherankan.Gedongnya ditengah = tinggi percaya dirinya  Bahayanya : terkena pasangan. Tangkalnya : selamatan nasi pulen beras sepitrah diliwet, lauknya daging bebek dan ayam dipindang, kuah merah dan putih dan ketimun 25 buah. Selawatnya : pisau baja dan jarum satu. Doanya : slamet dina. Candranya : idune lir upas ratjun = dihargai semua perkataannya. Ketika “kala wuku” berada di barat daya, dalam 7 hari tidak boleh mengunjungi tempat kala."},
    {Madangkungan: "sanghyang basuki : ahli bicara, tawakal, tetap hatinya. Pohonnya : plasa = hanya jadi perhiasan hutan, tidak ada gunanya. Burungnya : pelug = suka tinggal di air, suka tinggal ditempat sunyi. Gedungnya di atas = mendewa-dewakan kekayaannya, tawakal, hemat. Bahayanya : dibunuh pada waktu malam.Tangkalnya: Selamatan nasi punar beras sepitrah dikukus, lauknya daging ayam kuning (wiring kuning) dan berumbun, digoreng, jenang merah pada waktu hari kelahirannya. Selawatnya : 5 keteng. Doanya : ngumur. Candranya : umajang kang tetabuhan = menepati perkataan, dan dapat menyenangkan hati orang lain. Ketika “kaa wuku” berada di timur, dalam 7 hari tak boleh mendatangi kala"},
    {Maktal: "sanghyang sakri = lurus hatinya, baik pekerjaannya. Pohonnya : nagasari = bagus rupanya, lemah lembut tutur katanya, dicintai oleh pembesar. Burungnya : ayam hutan = liar dan tinggi budinya, banyak tanda-tandanya akan mendapat bahagia, suka tinggal ditempat sunyi. Gedungnya ditumpangi tunggal = kaya benda dan dihormati. Bahayanya = bertikai.Tangkalnya : selamatan nasi uduk, daging ayam dan bebek dimasak 2 macam, dipindang dan dimasak dengan santan, niatnya : ngrasul. Selawatnya 4 keteng. Doanya : rasul. Candranya : lesus awor lan pancawara = lebar pemandangannya, dalam pikirannya. Ketika “kala wuku” berada di timur laut, dalam 7 hari tak boleh mendatangi kala"},
    {Wuje: "betara kuwera = menggirangkan hati orang lain, perkataannya lurus dan mengherankan, singkat hati, tetapi sebentar baik. Memasang keris terhunus disebelah kaki = waspada dan tajam hatinya. Pohonnya : Tal = panjang umurnya, besar tanda kebahagiannya, kuat dan tetap hatinya. Burungnya : gogik = cemburuan, tak suka kepada keramaian. Gedungnya terlentang didepan = pengasih.Bahayanya : diteluh. Tangkalnya : selamatan jajan pasar secukupnya dan bermacam-macam ketan seharga sataksawe (+/- 10 sen). Yang dibeli dahulu madu untuk selanunggal rum arum = peteng hati, sukar dijalani, suka kepada bau harum, besar kehendaknya. Ketika “kala wuku “ berada di barat, dalam 7 hari tak boleh mendatangi tempat kala."},
    {Manahil: "Sanghyang Batara Citragatra = menjunjung diri sendiri, dapat berkumpul ditempat ramai, bakat angkuh, selalu bersedia-sedia untuk membela diri. Air dijembung dibelakangnya = Arum perintahnya, akan tetapi tak mempunyai pangkat. Memangku tombak terhunus = waspada dan tajam hatinya.Pohonnya : Tageron = sedikit faedahnya, liat hatinya. Burungnya : Sepahan = liar budinya, tajam pikirannya. Bahayannya : terkena senjata tajam.Penangkalnya : selamatan nasi liwet beras sepitrah, lauknya daging ayam dan ikan, sayuran secukupnya, sambal gepeng. Selawatnya 8 keteng. Doanya : Selamat tolak bilahi. Candranya : Trenggana abra ing wijit = sabar segala kemauannya, tak suka menganggur, banyak kemauannya.Ketika kala wuku berapa di Tenggara, dalam 7 hari tak boleh mendatangi tempat kala."},
    {Prangbakat: "Sanghyang Batara Bisma = pemarah, tangkas, pemalu, memperlihatkan watak prajurit, menghendaki jadi pemimpin orang, lurus pembicaraannya, segala yang dikehendaki tak ada sukarnya. Kakinya kanan direndam dalam air jembung = perintahnya dingin didepan panas dibelakang. Pohonnya : Tirisan = panjang umurnya, cukup rejekinya, tetap pikiranya.Burungnya : urang-urangan = cepat kerjanya. Bahayanya : memanjat atu karena tingkahnya sendiri. Tangkalnya : selamatan nasi tumpeng beras sepitrah, lauknya daging sapi, dimasak bumbu manis, sayuran secukupnya. Selawatnya : pacul. Doanya : aelamat pina. Candranya : wesi trate pulasani = keras hatinya, cepat kerjanya, pemberi, jujur, belas kasihan. Ketika “kala wuku” berada dibawah, dalam 7 hari tak boleh turun dari gunung dan menggali tanah."},
    {Bala: "Sanghyangbatari Durga = suka berbuat huru-hara,membuat berita, jahil, suka bercampur dengan kejahatan, tak ada yang ditakuti, pandai sekali bertindak jahat. Pohonnya : cemara = ramai bicaranya, lemah lembut perintahnya dan dihormati.Burungnya : Ayam hutan = liar budinya, dicintai oleh pembesar, tinggi budinya, banyak tanda-tanda akan mendapat bahagia, suka tinggal ditempat yang sunyi. Gedungnya didepan = memperlihatkan kekayaannya, pradah dilahir. Bahayanya : diteluh dan kena upas.Penangkalnya : selamatan nasi tumpeng beras sepitrah dikukus, sayur 7 macam, panggang ayam hitam. Selawatnya 40 keteng. Doanya : Rajukna : Udan salah mangsa = rejekinya dari jual beli.Ketika kala wuku berada di Barat-Laut, dalam 7 hari tak boleh mendatangi tempat kala."},
    {Wugu: "Sanghyang Batara Singajala = banyak akal, lekas mengerti, baik budinya. Pohonya : Wuni sedang berbuah = siapa yang melihat bagaikan mengidam, akan tetapi jika telah makan, sering mencela, banyak rejekinya. Burungnya : Podang = cemburuan, tidak suka berkumpul. Gedungnya tertutup dibelakang = hemat dan pendia. Bahayanya : digigit ular dan disia-sia.Penangkalnya : selamatan nasi pulen beras sepitrah dikukus dan bermacam-macam ketan, jajan pasar, lauknya daging bebek putih sejodoh dimasak dengan santan. Selawatnya 10 keteng. Doanya: Selamat. Candranya : awang-uwung = baik budinya.Ketika kala wuku berada di sebelah Selatan, dalam 7 hari tak boleh mendatangi tempat kala."},
    {Wayang: "Sanghyang batari Sri = banyak rejekinya, pradah, bakti, teliti, dingin perintahnya dicintai oleh orang banyak. Jembung berisi air didepan dan duduk disitu = sejuk hatinya, sabar, rela hati, akan tetapi harus diperlihatkan pemberiannya. Pasang keris terhunus = perintahnya mudah didepan, sukar dibelakang. Pohonnya = Cempaka = dicintai oleh orang banyakBurungnya = Ayam hutan = dicintai oleh pembesar, liar budinya, berbakat angkuh, senang tinggal ditempat yang sunyi. Bahayanya : kenah tulah dan difitnah.Penangkalnya : selamatan nasi tumpeng beras sepitrah dikukus, daging kambing kendit dimasak macam-macam ketan, ayam dimasak sesukanya, sayuran secukupnya. Selawatnya 40 keteng. Doanya : selamat. Candranya : damar murub, bumi langit = selamat, banyak ilmunya.Ketika kolo wuku berada diatas, dalam 7 hari tak boleh naik."},
    {Kulawu: "Sanghyang Batara Sadana = kuat budinya, besar harapannya. Duduk dijembung berisi air ditepi kolam = sejuk hatinya, dingin perintahnya. Membelakangi senjata tajam = pikirannya terdapat dibelakang, kurang pandai. Pohonnya : Tal = panjang umurnya, besar harapannya, kuat budinya.Burungnya : Nori, boros, murka. Gedungnya didepan = memperlihatkan kekayaannya, pradah hanya lahir. Bahayanya : terkena bisa. Penangkalnya : selamatannasi golong beras sepitrah dikukus, lauknya daging ayam dan bebek yang berwarna merah, ikan dan daging burung, dimasak sekehendahnya. Selawatnya 5 keteng. Doanya : Kabula. Candranya : Bun tumetes ing sendang = ketika kecil miskin, akhirnya besar kebahagiannya, banyak rejekinya.Ketika kala wuku berada di Utara, dalam 7 hari tak boleh mendatangi tempat kala."},
    {Dukut: "Sanghyang Batara Sakri = keras hatinya. Menghadapi keris terhunus = waspada, tajam pikirannya, segala yang dilihatnya berhasrat dipunyainya. Pohonnya : Pandan wangi = kiri tempatnya, dengki, tak boleh didekati. Burungnya : Ayam hutan = dicintai oleh para pembesar, liar dan tinggi budinya, besar harapannya, suka tinggal ditempat sunyi.Membelakangi gedungnya = hemat dan pendiam. Bahayanya : dimedan perang.Penangkalnya : selamatan nasi tumpeng beras sepitrah dikukus, lauknya panggang ayam putih mulus dan ayam brumbun. Selawatnya satakswawe. Doanya : Slamet. Candranya : tunggul asri sesengkeraning nata = bagus rupanya, penakut.Ketika kala wuku berada di Barat, dalam 7 hari tak boleh mendatangi tempat kala."},
    {Watugunung: "Sanghyang Batara Antaboga dan batari Nagagini. Antaboga = senang tinggal alam untuk bertapa. Nagagini = gemar kepada asamara. Menghendaki janji = suka bertapa ditempat yang sunyi, jika menjadi pendita, mendapat kehormatan, gemar bersemedi, sering bersedih hati. Pohonnya : Wijayakusuma = rupawan, tinggi budinya, tidak suka pada keramaian, terlihat angkuh, teliti. Burungnya : Gogik = cemburuan. Bilahinya : teraniaya.Penangkalnya : selamatan beras sepitrah dikukus, lauknya daging binatang yang diburu, binatang berliang, burung, semuanya yang halal, dimasak bermacam-macam jenang, daun-daunan 7 macam. Selawatnya 9 keteng. Doanya : Mubarak. Candranya : Lintang wulan keraianan = terang hatinya, tetapi tidak bercahaya.Ketika kala wuku berapa di timur, dalam 7 hari tak boleh mendatangi tempat kala."}]
hariLahir = {
    Senin : 'Tidak pelit, ikhlas hati dalam memberi, tidak bisa menyimpan uang, senang membela kebenaran, mudah tersinggung dan tidak pandai bicara.',
    Selasa : 'Mudah terpengaruh, tidak mempunyai pendirian tetap, gampang naik darah, tidak sabaran dan selalu mau menang sendiri.',
    Rabu : 'Pendiam namun kalau sudah bicara tidak terduga, tidak suka mencampuri urusan orang lain, baik hati, suka menolong dan banyak rejeki.',
    Kamis : 'Pendiriannya tidak tetap, suka dipuji, mudah emosi, mudah terbujuk oleh rayuan halus dan tidak sabaran.',
    Jumat : 'Disukai orang banyak, kuat mental, suka menolong, suka memberi nasehat yang baik dan suka mempelajari ilmu pengetahuan.',
    Sabtu : 'Giat bekerja, rajin pandai mencarari rejeki, ditakuti orang banyak, pandai menempatkan diri dan bisa menyelesaikan apa yang menjadi tanggung jawabnya dengan baik.',
    Minggu : 'Pandai bergaul, disukai orang banyak, berjiwa besar, suka merendahkan diri, pandai berbicara dan dapat mengatasi masalah yang dihadapiya dengan baik.'
}
tanggalLahir = {
    'Tanggal 1' : 'Lahir pada tanggal satu berarti Anda mempunyai kemauan yang keras, mandiri dan percaya diri. Orang lain mungkin berkata Anda "terlalu banyak berpikir" karena Anda lebih suka berencana namun tidak benar-benar menjalankannya. Anda cenderung mendiagnosa apa yang salah daripada membenahinya. Anda memiliki pemikiran yang bagus dan suka berunding. Praktis dan idealis, Anda menyukai hal-hal yang diukur oleh otak daripada hati Anda. Akibatnya, walaupun Anda mampu memberikan kasih sayang, Anda tidak menunjukkannya terang-terangan. Di balik kemandirian Anda, Anda adalah seseorang yang sangat sensitif dan membutuhkan dorongan dan feedback (umpan balik) yang positif. Anda juga memiliki kekuatan besar yang terpendam.',
    'Tanggal 2' : 'Lahir pada tanggal dua menunjukkan bahwa Anda sangat emosional dan sensitif terhadap sekitar Anda. Walaupun kadang-kadang gugup dan pelupa, Anda mudah sekali berteman dan mereka menyukai Anda. Anda memiliki sifat yang hangat dan membutuhkan kasih sayang yang ditunjukkan secara nyata. Dengan kata lain, Anda suka dengan orang yang "berepot-repot" untuk Anda. Penting bagi Anda untuk menghindari perubahan suasana hati dan segala sesuatu yang membuat Anda depresi. Meskipun Anda menyukai benda-benda materi, Anda tidak selalu bersungguh-sungguh untuk mendapatkannya. Bakat ritmis Anda bisa diwujudkan dalam menulis puisi atau musik.',
    'Tanggal 3' : 'Lahir pada tanggal tiga menunjukkan bahwa Anda memiliki vitalitas yang tinggi dan cepat sembuh dari penyakit. Daya imajinasi Anda cukup bagus untuk membuat suatu cerita menarik yang berasal dari suatu kejadian kecil. Anda memiliki kemampuan kritis dan literatur yang alami, dan membutuhkan aktivitas bervariasi untuk membuat Anda tetap sibuk. Sarat dan ekstrim dalam kasih sayang, Anda mengalami krisis emosional di mana Anda mampu sembuh darinya dengan cepat. Anda seseorang yang sosial, ekspresif di depan publik dan bersikap terbaik di depan penonton. Walaupun Anda merasa gelisah, Anda masih mudah merasa puas dan mampu melakukan yang terbaik dalam situasi apapun.',
    'Tanggal 4' : 'Lahir pada tanggal empat menunjukkan individu bersegi empat, pecinta alam, rumah, keluarga dan negara. Andalah yang sukses dalam segala bentuk usaha produksi - manufaktur, bangunan, bisnis, tekstil. Musik, seni lukis atau seni pahat membuat Anda merasa santai walaupun Anda bisa mengomersialkannya juga. Anda lebih suka memberi ide-ide dan memaksakannya sedikit kepada orang lain, menganggap Anda sendiri sebagai penilai terakhir yang berkelakukan dan beretika benar. Kepercayaan Anda pada kedisiplinan membuat Anda sulit mengekspresikan perasaan, dan akibatnya Anda mengalami penderitaan batin. Untuk urusan pekerjaan, Anda mendorong diri bekerja tanpa mengenal lelah, dan sayangnya orang lain terkena juga. Anda memiliki kecenderungan untuk bekerja lembur dan bila perlu, Anda akan menjadwalkan rekreasi.',
    'Tanggal 5' : 'Lahir pada tanggal lima menunjukkan bahwa Anda mudah beradaptasi, antusias dan kadang-kadang membual. Anda memiliki pemikiran cerdas, imajinasi aktif dan suka "membumbui" cerita Anda. Anda cinta kehidupan, seorang yang sehat enerjik, teman yang luar biasa dan suka dengan hal-hal yang bergerak cepat/dinamis. Hidup Anda dipenuhi dengan pengalaman-pengalaman baru dan perubahan terus-menerus. Walaupun Anda merupakan jenis yang menolak "terikat" dengan hal apapun, Anda adalah tipe orang "menikah". Anda juga memiliki suara merdu.',
    'Tanggal 6' : 'Lahir pada tanggal enam menunjukkan bahwa Anda pecinta alam. Anda berkembang dengan pujian dan penghargaan, tetapi goyah dengan kritikan. Dalam hubungan cinta, Anda memberikan segalanya kepada pasangan Anda - paling tidak selama Anda berdua masih menjalin cinta. Anda mencari kesempurnaan dan jarang mendapatkannya, sehingga Anda berusaha mencari di tempat lainnya. Akibatnya, Anda terkenal sebagai orang tidak dapat dipercayai. Anda menyukai anak-anak, tapi tidak perlu memilikinya sendiri untuk hidup bahagia. Walaupun Anda terlindungi dengan baik, Anda terus merasa kuatir tidak mempunyai cukup uang. Mentalitas lebih dominan daripada intelektualitas, dan Anda memiliki kemampuan acting (sandiwara) yang membuat Anda sukses di panggung atau di dunia bisnis. Anda memiliki kecendurangan literatur dan artisitik, dan dapat menarik uang atau dukungan bila Anda perlu. Satu-satunya bidang yang tidak Anda kuasai adalah mekanika. Berada di antara orang-orang dalam suasana yang harmonis penting bagi Anda.',
    'Tanggal 7' : 'Lahir tanggal tujuh menunjukkan seorang ahli dengan daya pikir tajam untuk analisa mental yang dalam. Anda seharusnya jangan berjudi atau berspekulasi; sebaliknya, Anda harus memeriksa dengan teliti semua bisnis sebelum Anda terjun di dalamnya. Berintuisi tinggi bila tidak psikis (cenayang), Anda sebaiknya jangan pernah menuruti nasihat yang menentang insting Anda. Anda harus MENUNGGU untuk apa yang Anda inginkan daripada mencarinya dengan agresif. Apa yang Anda inginkan akan datang sendiri hanya bila Anda tidak aktif mencarinya. Anda berbakat memainkan alat musik bersenar (termasuk piano) dan organ. Anda juga berpenilaian bagus dalam bidang keuangan. Pendapat Anda tegas, dan Anda tidak suka mengubahnya. Anda mengalami kesulitan beradaptasi secara fisik dan Anda cenderung menyendiri, di mana keduanya membuat pernikahan Anda menjadi sulit. Luangkan waktu setiap harinya untuk bersantai dan meditasi.',
    'Tanggal 8' : 'Lahir pada tanggal delapan menunjukkan Anda seorang yang kreatif dan produktif ditambah dengan kepandaian berbisnis. Progresif dan berwawasan luas, Anda akan sukses menangani masalah umum atau kepentingan publik, namun sebaiknya hindari kerja sama seimbang karena Anda perlu berada di posisi yang mengambil keputusan terakhir. Bisnis besar, perusahaan atau pemerintah adalah bidang Anda, di mana Anda harus menunjukkan kejujuran dan integritas agar tetap sukses. Lebih suka buku daripada membaca, Anda juga lebih suka melakukan hal berhubungan dengan uang besar; bila Anda memilikinya, Anda akan memberikan sejumlah uang besar kepada institusi atau badan amal. Anda kadang sok pamer dan menginginkan keluarga Anda menjadi kepercayaan Anda.',
    'Tanggal 9' : 'Lahir pada tanggal sembilan menunjukan publisitas, distribusi, seni, wawasan luas dan perikemanusiaan (definisi dari film The Wizard of Oz adalah "melakukan hal yang baik"). Anda tertarik dalam bidang metafisika dan menghubungkannya dengan apa yang sedang terjadi di dunia ini. Berpendidikan, artistik dan berkemauan keras, Anda adalah pemimpin alamiah yang dapat sukses dalam segala sesuatu berbau artistik, seperti menulis, mengajar, hukum, penerbitan atau pastoral. Anda memerlukan pendidikan luas sehingga Anda bisa memilih pekerjaan dengan lebih baik. Anda milik dan berada di dalam dunia yang membuat Anda sulit untuk menjalani kehidupan pribadi yang sukses. Pernikahan akan berakhir di tengah-tengah jalan hidup Anda, baik karena kematian, perceraian atau perpisahan walaupun cinta tetap ada. Kehidupan Anda sebenarnya dipenuhi dengan perjalanan jauh dan banyak perubahan.',
    'Tanggal 10' : 'Lahir pada tanggal sepuluh menunjukkan seseorang dengan banyak minat dan mampu melakukan beberapa hal dalam waktu yang sama. Banyak orang lain yang bergantung pada Anda, tetapi sedikit yang menawarkan bantuan sehingga Anda merasa terasing dan sendirian. Anda memiliki pemikiran bagus dan kemauan keras, dan merupakan promotor ahli bagi hal-hal yang Anda percayai. Sehubungan dengan teman dan harta benda, Anda kadang cemburu dan eksklusif - Anda tidak ingin berbagi. Bakat kreatif Anda paling tepat diwujudkan dalam dunia bisnis, sedangkan seni, terutama musik atau melukis, hanyalah aktivitas sampingan saja. Anda termasuk orang ramah, tapi Anda tidak menyukai detil-detil perawatan rumah. Vitalitas membuat Anda cepat sembuh dari sakit fisik dan emosional.',
    'Tanggal 11' : 'Lahir pada tanggal sebelas menunjukkan individu yang penuh inspirasi dan imajinatif dengan kebulatan tekad dan ketekunan, tetapi juga disertai dengan keragu-raguan. Dengan sifat ini, Anda begitu dramatis dalam pikiran dan tindakan, brilian, cerdik, namun juga gugup dan tegang. Anda bereaksi cepat dan perlu hati-hati agar intelektualitas Anda tidak menutupi intuisi. Anda cenderung menekankan kode moral Anda sendiri kepada orang lain dan tidak meyukai kelemahan manusia. Gairah Anda tinggi, berlebihan dan tidak beralasan; sebenarnya, Anda adalah orang yang ekstrim, kadang serasa di awang-awang, kadang serasa di dalam jurang gelap. Dalam bereaksi terhadap suasana ekstrim ini, hindari pembenahan yang terlalu berlebihan. Perhatikan kesehatan Anda, dan hindari kecenderungan untuk egois, serakah dan membual tentang diri sendiri.',
    'Tanggal 12' : 'Lahir pada tanggal dua belas menunjukkan seseorang yang brilian, magnetis, imajinatif dan sosok pembicara bagus yang sangat meyakinkan dalam argumentasi. Karena Anda memiliki pemikiran seimbang, cenderung artistik serta menikmati hidup dan aksi, Anda bisa sukses sebagai pengacara, aktor/aktris atau bekerja di bidang penjualan dan periklanan. Idealisme tinggi Anda menuntut adanya "misi" dalam kehidupan. Anda perlu mempertahankan aktivitas intelektual untuk menghindari naik-turun (roda kehidupan) yang merupakan kelemahan orang yang lahir pada tanggal tiga. Bakat desain Anda bisa disalurkan lewat arsitektur atau dekorasi interior. Genit dan cenderung berselingkuh, Anda butuh menyelesaikan apa yang Anda mulai dan berusahalah untuk tidak menimbulkan masalah.',
    'Tanggal 13' : 'Lahir pada tanggal tiga belas menunjukkan adanya teka-teki dalam sebuah kontradiksi, kreativitas, ekspansi dan keresahan dibalik keteraturan dan keterbatasan. Anda sensitif dan spiritual, menderita karena lingkungan Anda sendiri, dan suka marah. Pemikiran Anda diseimbangkan oleh kemauan keras, dan walaupun Anda memiliki cinta yang kuat, Anda jarang menunjukkannya dan menderita karenanya. Karena salah paham, Anda sering dianggap bertemperamen tinggi dan tidak masuk akal. Walaupun Anda cenderung bersifat diktator, Anda adalah seorang manajer yang bagus. Kesuksesan terbaik Anda berhubungan dengan tanah - pertambangan, geologi, konstruksi praktis. Anda juga bersifat dikotomi, di mana Anda menyukai memakai seragam tetapi membenci perang. Rumah berarti penting bagi kebahagiaan Anda.',
    'Tanggal 14' : 'Lahir pada tanggal empat belas menunjukkan seseorang yang cakap dan berkepribadian rangkap dengan pemikiran logis dan percaya pada ramalan. "Beruntung" dalam permainan dan kontes, Anda adalah seorang petaruh dan penjudi alami. Kesuksesan Anda terletak pada bisnis besar, tetapi Anda membutuhkan ekspresi artistik untuk rekreasi dan "mendinginkan kepala". Sangat emosional, Anda selalu dapat menarik hati melalui perasaan dan simpati Anda. Anda cenderung membutuhkan perubahan konstan - obat-obatan, alkohol, dan bercinta dengan siapa saja dan bentuk pelepasan seksual berlebihan lainnya. Anda bisa juga menjembatani antara dunia fana dengan spiritual, dan memiliki kekuatan besar untuk membangun atau menghancurkan - sesuai dengan pilihan Anda.',
    'Tanggal 15' : 'Lahir pada tanggal lima belas menunjukkan seseorang berbakat yang berada dalam perlindungan tanggal enam yang bersifat baik dan harmonis yang meresap pengetahuan daripada belajar keras. Sebenarnya, Anda menarik banyak hal - teman, hadiah, uang, kesempatan dan memiliki impresi kemudaan dan kesehatan. Anda rela berkorban diri demi suatu hal yang baik atau demi menolong teman, tetapi Anda tidak ingin didominasi. Anda berpikiran ilmiah tetapi Anda sering berekspresi lewat musik; walaupun kesuksesan Anda terletak pada karir profesional, musik memegang peranan penting dalam hidup Anda. Anda mencintai rumah, dan walaupun Anda bersifat demonstratif dan murah hati, Anda lebih menyukai berderma secara individual dibandingkan berperikemanusiaan secara institusi.',
    'Tanggal 16' : 'Lahir pada tanggal enam belas menunjukkan orang gugup dan mudah tersinggung yang suka menimbulkan masalah dan keruwetan di mana nantinya Anda menderita akan akibatnya. Suka menyendiri, Anda tetap saja berpijak pada rumah dan kasih sayang. Walaupun Anda bisa berhasil dalam bidang kesusasteraan, kemampuan Anda berlogika dan analisis menuntut penyaluran lewat bidang bisnis juga. Meskipun Anda tidak aktif dan agresif, Anda tidak suka rencana Anda dicampuri atau dihalangi oleh lainnya. Anda cenderung menunda melakukan sesuatu padahal Anda tahu untuk mengerjakannya saat itu juga, dan Anda terlalu memikirkan diri sendiri. Anda sangat menginginkan kasih sayang, tetapi Anda tidak perlu bersusah payah untuk mendapatkannya.',
    'Tanggal 17' : 'Lahir pada tanggal tujuh belas menunjukkan seseorang yang berpikiran tinggi, bangga pada dirinya, kadang liberal, kadang konservatif, murah hati atau kikir, hemat atau foya-foya. Berpegang teguh pada ide-ide sendiri, Anda jarang menyerah pada orang lain; dalam bidang bisnis, Anda terbaik dengan memegang jabatan kepala/pimpinan perusahaan dan bekerja dengan rekanan di bawah Anda. Anda melakukan apa yang ingin Anda lakukan, berbakat dalam mengatur minat dan kepentingan orang lain, dan tertarik untuk berurusan dengan sesuatu yang besar. Detil-detil dipercayakan kepada orang lain karena Anda benci direpotinya. Anda sukses dalam bidang bisnis yang berhubungan dengan tanah (misalnya pertambangan, lansekap, minyak, peternakan), dan juga dalam mengarang meskipun Anda senang menulis tentang sejarah atau teknis daripada menulis fiksi. Anda menyukai pengetahuan umum dan suka menjelajah/menyelidiki. Bila berhubungan dengan hal-hal spiritual, Anda menginginkan bukti dulu.',
    'Tanggal 18' : 'Lahir pada tanggal delapan belas menunjukkan orang yang hidupnya dipenuhi dengan perubahan, aktivitas dan perjalanan. Anda suka bertanggung jawab terhadap kesejahteraan orang banyak atau komunitas, yang cocok dengan sifat suka menolong Anda. Banyak yang diharapkan dari Anda karena banyak juga yang diberikan kepada Anda: kemandirian orang tanggal satu, efisiensi orang tanggal delapan dan perikemanusiaan orang tanggal sembilan. Karena Anda tidak suka dengan nasihat, Anda juga jarang membutuhkannya. Anda tertarik dengan bidang luas yang membutuhkan administrasi efisien (seperti hukum, politik, agama), dan walaupun usaha pertama Anda tidak selalu berhasil, Anda akan berhasil pada usaha berikutnya, jadi berusahalah terus. Kadang emosional, Anda sebenarnya intelektual dan menyukai logika serta argumentasi. Sifat ini membuat Anda cocok sebagai kritikus drama, penulis atau pembicara. Dalam bidang keuangan, Anda tidak pernah terburu-buru karena Anda merasa bertanggung jawab sekali dalam mengatur aset material. Pernikahan atau pertunangan yang terjadi di tengah-tengah jalan kehidupan Anda akan terputus.',
    'Tanggal 19' : 'Lahir pada tanggal sembilan belas menunjukkan getaran nada orang tanggal satu sampai sembilan yang memoengaruhi kepribadian Anda. Logis, tekun, ulet, praktis, artistik dan universal, Anda bisa berada di puncak ketinggian atau jatuh ke lubang yang dalam sehubungan dengan tindakan dan emosi. Anda mandiri dan tidak menyerah pada keterbatasan. Kemandirian ini merupakan sumber ketidaksukaan Anda terhadap undang-undang masyarakat, yang mana tidak Anda ikuti dalam kehidupan pribadi tanpa menyinggung publik. Kepandaian Anda dalam banyak hal menciptakan banyak pilihan karir meskipun Anda lebih cocok menjadi seorang profesional daripada terjun dalam bidang bisnis. Rasa tanggung jawab dan dorongan hati yang kuat Anda untuk mencapai kondisi yang lebih baik membekali Anda untuk terjun dalam dunia politik bila Anda memang tertarik. Anda menyukai perubahan dan variasi, selalu mengubah keadaan di sekitar Anda dan akan beradaptasi terhadapnya.',
    'Tanggal 20' : 'Lahir pada tanggal dua puluh menunjukkan orang yang cocok untuk usaha kecil serta berada dalam suasana keakraban dan protektif. Anda memilih bekerja bekerja sama dengan orang lain daripada menanggung semua tanggung jawab sendiri, dan kadang tidak tertarik untuk berkembang untuk usaha/bidang yang lebih besar. Walaupun Anda lebih baik berekspresi lewat tulisan daripada secara lisan di depan publik, rasa iba naluriah dan sensitivitas yang dimiliki membuat Anda cocok di bidang politik dan pendeta. Simpatik dan penuh kasih sayang, Anda mampu memperoleh pengetahuan yang cukup dan sebaiknya mendapatkan pendidikan yang tinggi. Perhatian pada detil membuat Anda cocok dengan profesi yang membutuhkan sifat tersebut, seperti hukum perusahaan dan manajemen properti. Anda lebih memilih hidup di pedesaan ketimbang di kota serta sangat berkepentingan dalam rumah, keluarga dan teman. Walaupun Anda suka menolong, Anda tidak tertarik terhadap kerja jasmani yang dapat dihindari. Musik meringankan pikiran Anda walapun Anda sebaiknya melakukannya dalam sebuah grup daripada bersolo karir.',
    'Tanggal 21' : 'Lahir pada tanggal dua puluh satu menunjukkan orang yang dikarunia dengan nyanyian dan suara merdu yang merupakan aset berharga. Mempesona dan musikal, menyukai kecantikan, seni dan tari, Anda terkadang gugup dan tegang. Anda perlu berpegang pada keengganan yang tidak dapat dijelaskan terhadap hal dan orang tertentu. Berhubungan dengan cinta, Anda cenderung bersikap menerima daripada mengekspresikannya secara aktif, tetapi Anda meletakkan harga diri besar pada obyek yang menjadi pusat perhatian Anda. Imajinasi aktif Anda sering membuat Anda curiga sendiri, yang akan mengakibatkan masalah serius dalam hubungan, terutama dalam pernikahan. Hindari kecenderungan untuk berpikir terus-menerus atau menjadi depresi. Sudah menjadi sifat Anda tertarik pada buku, penerbitan, editing (pemeriksaan) dan bidang lain yang mirip, sehingga kesuksesan Anda terletak pada bidang apa saja yang berhubungan dengan pendidikan.',
    'Tanggal 22' : 'Lahir pada tanggal dua puluh dua menunjukkan sosok yang penuh energi yang berfungsi pada dua dunia: obyektif dan subyektif. Anda penuh dengan getaran, gugup dan gairah; Anda perlu istirahat dan ketenangan untuk "mengisi" dan menjaga keseimbangan Anda. Sangat intuitif, Anda sebaiknya berpijak pada impresi pertama yang didapat. Walaupun Anda memiliki kekuatan yang terbatas, Anda selalu saja berada di antara mengekspresikan idealisme Anda dan menjaganya dalam batasan konstruktif. Orang yang lahir pada tanggal 22 memiliki misi utilitarianisme universal, yang mana hanya menyisakan sedikit ruang bagi ambisi pribadi. Sukses besar Anda terletak pada bidang yang penuh sistem, dalam area mana saja selama cocok dengan idealisme Anda dan menghasilkan kebaikan. Hindari transaksi yang meragukan atau ilegal; Anda pasti akan tertangkap dan menderita karenanya.',
    'Tanggal 23' : 'Lahir pada tanggal dua puluh tiga menunjukkan orang yang simpatik, sensitif, penuh pengertian dan berpikiran praktis. Anda memiliki bakat untuk mendiagnosa penyakit fisik, sehingga Anda akan meraih sukses bila bekerja di bidang kedokteran atau pengobatan (tetapi bukan bedah, karena "misi" Anda adalah untuk membangun dan menyembuhkan bukan merobek atau menghancurkan). Kemampuan teknis dan praktis Anda bisa menimbulkan minat pada bidang hukum, kimiawi atau saham, tetapi Anda terlalu praktis untuk bisa berhasil di bidang seni. Sanggup menghidupi diri sendiri, populer dan sosial, Anda tidak menderita dari rasa rendah diri. Anda memperoleh banyak dari kehidupan karena Anda mencoba yang terbaik dari segala situasi. Anda merupakan teman baik yang rela bertanggung jawab.',
    'Tanggal 24' : 'Lahir pada tanggal dua puluh empat menunjukkan sosok yang sangat aktif yang selalu berusaha maju terus agar tidak membuang-buang energi. Walaupun Anda berkonsentrasi pada satu hal dalam suatu waktu, Anda hidup dengan perubahan konstan; Anda bukanlah tipe orang pensiunan karena Anda butuh untuk terus berkembang. Anda sangat terikat pada seni, dan memiliki bakat alami untuk tampil di atas panggung - secara alami, Anda cocok dalam bidang drama, tetapi Anda lebih sukses dalam bidang bisnis atau properti. Penampilan tidak penting bagi Anda, jadi Anda tidak begitu mementingkan waktu dan uang. Pada dasarnya, Anda praktis, dengan sedikit mimpi dan kecendurangan besar untuk melebihkan kesenangan dan penderitaan Anda. Anda juga bersifat domestik secara alami, dibarengi dengan rasa ego yang telah berkembang dan akan belajar banyak melalui pengamatan Anda. Hindari depresi, kecemburuan dan kekuatiran.',
    'Tanggal 25' : 'Lahir pada tanggal dua puluh lima menunjukkan orang yang secara alami dapat meramal dan sangat intuitif dengan kemampuan gaib yang kuat. Anda cenderung berterus-terang dalam menyatakan perasaan Anda dan tidak selalu dimengerti oleh orang lain. Berbakat artistik, Anda bisa mengomersialkan berbagai lahan seni yang Anda sukai. Kesuksesan juga bisa diraih lewat profesi, bisnis atau bidang politik. Anda cenderung untuk bimbang dan tidak konsisten, dan Anda akan menderita karenanya sampai Anda bisa menghilangkan kecenderungan ini. Penting sekali bagi Anda untuk belajar berkonsentrasi, berpikir stabil dan membuang jauh rasa rendah diri, iba pada diri sendiri dan depresi. Kasih sayang adalah kelemahan terbesar Anda. Anda harus selalu berada di jalan lurus dan sempit, karena Anda cenderung keluar dari jalan tersebut dan tertarik untuk berkhotbah tetapi bertindak keterlaluan. Idealistis dan penuh harapan, Anda perlu memerangi rasa malas Anda.',
    'Tanggal 26' : 'Lahir pada tanggal dua puluh enam menunjukkan orang yang penuh dengan lemari dan laci, karena bagi Anda tidak ada yang terlalu kecil untuk fungsi praktis, dan Anda baru mengetahui membutuhkan satu hal setelah Anda membuangnya. Anda sangat introspektif dan cenderung hidup dengan bayang-bayang masa lalu - ke perusakan masa sekarang dan masa depan. Walaupun Anda memulai banyak hal, Anda menemui kesulitan untuk menyelesaikannya, dan Anda sendiri yang memilih untuk meningkat atau jatuh di bawah rata-rata. Anda bisa mengomersialkan semua lahan seni - kecuali musik - dengan langkah yang besar. Anda bisa sukses di bidang politik dan diplomasi, dan seharusnya Anda memperoleh pendidikan tinggi. Anda adalah tipe "menikah" serta memiliki sifat domestik yang indah, mencintai rumah dan anak-anak. Tidak puas dengan milik Anda dan menyukai warna-warna yang terlihat pada pakaian yang dikenakan, Anda sebenarnya tidak terlalu menekankan pada kepuasan fisik dan sangat murah hati pada orang lain.',
    'Tanggal 27' : 'Lahir pada tanggal dua puluh tujuh menunjukkan seseorang yang tertarik dengan kekayaan materi dibandingkan dengan orang yang lahir dengan tanggal kelipatan 9 lainnya (tanggal 9 dan 18). Orang 27 memiliki ikatan pernikahan yang kuat walaupun pengalamannya mungkin mengecewakan. Anda adalah pemimpin yang kuat, agak tekun, terkadang aneh dan tidak puas dengan kedudukan sebagai bawahan. Anda juga tidak suka bertanggung jawab terhadap tindakan Anda. Trampil dalam berbagai hal dan artistik, Anda juga memiliki bakat literatur dan bisa menjadi jurnalis, penulis, dosen atau guru. Anda bergairah dalam kasih sayang tetapi cenderung berlebihan. Keagamaan Anda lebih condong ke nilai-nilai religius Timur dan jauh dari ortodoks.',
    'Tanggal 28' : 'Lahir pada tanggal dua puluh delapan menunjukkan sosok yang memiliki kemauan keras, dominan dan ulet yang penuh dengan rasa cinta dan rela berkorban demi cinta. Sehubungan dengan ini, pernikahan Anda mungkin tidak konvesional, tetapi Anda selalu berusaha menjaganya sesuai dengan idealisme Anda. Bersifat eksekutif (melaksanakan sesuatu), Anda ingin tampil unggul dan akan berkorban untuk meraihnya. Kecenderungan Anda untuk melamun dan membuang-buang waktu dapat menghapus kemampuan Anda, sehingga tekanlah rasa malas yang muncul agar tidak sampai menguasai diri Anda. Rasa kecewa Anda kebanyakan datang dari melebih-lebihkan segala yang menjadi perhatian Anda. Kebebasan penting bagi Anda; Anda menderita bila dikekang atau dibatasi dalam segala hal. Hati-hati, jangan sampai menurunkan idealisme Anda sekali Anda mewujudkannya, karena hal ini akan menjauhkan Anda dari keberhasilan Anda.',
    'Tanggal 29' : 'Lahir pada tanggal dua puluh sembilan menunjukkan inspirasi, kerohanian dan kepemimpinan, karena 29 merupakan sumber getaran (2+9=11). Anda mimiliki kemampuan unik untuk menyatukan pihak-pihak yang berbeda dan dapat menengahi masalah kerja atau menyatukan perbedaan agama. Kekuatan Anda besar; Anda dapat menggunakannya untuk membawa kehormatan atau kehancuran bagi diri Anda dan orang lain - sesuai dengan pilihan Anda. Anda berlaku ekstrim dalam segala hal, hebat dalam cinta dan penilaian. Rumah penting bagi kebahagiaan Anda, tetapi Anda suka murung dan tegang, dan tidak mudah hidup bersama Anda. Anda terpaku pada mimpi, aspirasi dan rencana Anda, dan melupakan perasaan orang-orang di sekitar Anda. Anda memerlukan kerja yang pasti untuk membuat Anda seimbang dan efisien.',
    'Tanggal 30' : 'Lahir pada tanggal tiga puluh menunjukkan sosok yang vital, gugup dan jarang sakit karena kekebalan tubuh. Anda perlu menghindari berbagai jenis obsesi dan sebaiknya jangan mencoba kekuatan gaib untuk bersenang-senang. Tetapkan pendapat Anda. Anda selalu berpikir Andalah yang benar, mendasarkan kesimpulan Anda pada pengetahuan sedikit yang dilengkapi dengan imajinasi dan intuisi Anda sendiri. Bersifat setia dan seorang teman baik, Anda bisa menjadi guru, penulis atau pekerja sosial yang bagus. Anda genit dan suka diterimakasihi untuk hal-hal yang Anda kerjakan. Walaupun Anda dapat menjadi seorang manajer yang sempurna, Anda sangat tidak menyukai kerja.',
    'Tanggal 31' : 'Lahir pada tanggal tiga puluh satu menunjukkan sosok yang mirip dengan mereka yang lahir pada tanggal 13 yang sebaiknya tidak bermain-main dengan fenomena psikis. Aspirasi Anda tidak selalu masuk akal yang akhirnya menyebabkan kekecewaan; Anda perlu penerapan praktis, berusaha keras dan sabar agar kerja Anda berhasil. Anda tidak suka hidup sendiri dan tanggung jawab adalah stabilisator bagi Anda, sehingga Anda bolehlah dikatakan sebagai tipe "menikah". Anda memiliki keahlian bisnis, tetapi Anda harus sadar akan kecenderungan Anda sendiri untuk menghabiskan uang dan menghambur-hamburkan aset berharga secara sembrono. Dekorasi interior, menulis, kimiawi dan farmasi (Anda berbakat dalam meracik obat-obatan) adalah bidang karir yang cocok buat Anda. Anda tidak pernah melupakan kebaikan - atau luka.'
}
