wetonWanita = {
    7 :'Nilai neptu 7 hanya dimiliki oleh orang yang lahir di weton Selasa Wage. Orang dengan neptu ini bisanya memiliki watak sempit hatinya, tidak mempunyai teman, pemalas, suka ingkar janji terhadap wanita, bahkan sering berbuat gegabah, dan bila bercakap-cakap agak tersendat-sendat.',
    8 : 'Nilai neptu 8 hanya dimiliki oleh orang yang lahir di weton Senin Wage dan Selasa Legi. Orang dengan neptu ini bisanya memiliki watak panas hati, dengki, tidak mempunyai teman, sering bermuka masam, dan bila bertengkar sering mendatangkan bahaya, atau bila berbicara sering berakibat celaka. Dalam istilah primbon, watak ini disebut berlaku seperti bumi.',
    9 : 'Nilai neptu 9 hanya dimiliki oleh orang yang lahir di weton Minggu Wage dan Senin Legi. Orang dengan neptu ini bisanya memiliki watak lincah (teranjalan), suka berpindah-pindah dan jauh tujuannya, bersikap hanya untuk mementingkan isi perutnya sendiri, dan bila ia diguna-guna, ia akan kebal. Dalam istilah primbon, watak ini disebut berlaku seperti api.',
    10 : 'Nilai neptu 10 hanya dimiliki oleh orang yang lahir di weton Selasa Pon, Jumat Wage, dan Minggu Legi. Orang dengan neptu ini bisanya memiliki watak pendiam, bila disakiti hatinya tidak mudah marah, mudah menerima apa yang diajarkan (cerdas atau daya tangkapnya tinggi, dan bila menjadi seorang dukun tidak mudah ditanyai. Dalam istilah primbon, watak ini disebut berlaku seperti pelangi.',
    11 : 'Nilai neptu 11 hanya dimiliki oleh orang yang lahir di weton Senin Pon, Rabu Wage, Selasa Kliwon, dan Jumat Legi. Orang dengan neptu ini bisanya memiliki watak berani mati, besar malunya, mudah tersinggung, dan bila memiliki sesuatu sering dijualnya, malah kadang-kadang suka mencuri bila dalam keadaan kepepet. Dalam istilah primbon, watak ini disebut berlaku seperti bunga.',
    12 : 'Nilai neptu 12 hanya dimiliki oleh orang yang lahir di weton Minggu Pon, Kamis Wage, Senin Kliwon, Rabu Legi, dan Selasa Pahing. Orang dengan neptu ini bisanya memiliki watak menerima (Jw. neriman), banyak kepandaiannya, banyak orang sayang kepadanya, bila bekerja mudah, dan bila berumah tangga sering kehilangan. Dalam istilah primbon, watak ini disebut berlaku seperti jin.',
    13 : 'Nilai neptu 13 hanya dimiliki oleh orang yang lahir di weton Jumat Pon, Sabtu Wage, Minggu Kliwon, Kamis Legi, dan Senin Pahing. Orang dengan neptu ini bisanya memiliki watak tidak mempunyai perasaan, tetapi hatinya lemah lembut, berlaku baik terhadap saudara, dan berjiwa petualang (suka merantau). Dalam istilah primbon, watak ini disebut berlaku seperti bintang.',
    14 : 'Nilai neptu 14 hanya dimiliki oleh orang yang lahir di weton Rabu Pon, Jumat Kliwon, Sabtu Legi, dan Minggu Pahing. Orang dengan neptu ini bisanya memiliki watak apa saja mau (serba mau), apapun dapat dijalani, suka berbakti, sering mendapatkan kebahagiaan, mudah menerima pelajaran, disegani oleh orang lain, lemas hatinya, tetapi pemalas. Dalam istilah primbon, watak ini disebut berlaku seperti bulan.',
    15 : 'Nilai neptu 15 hanya dimiliki oleh orang yang lahir di weton Kamis Pon, Rabu Kliwon, dan Jumat Pahing. Orang dengan neptu ini bisanya memiliki watak suka memerintah (Jw. seneng ngongkon), keras hatinya dan keras pula bicaranya, tidak mau kurang makanan, banyak temannya, dan bila berumah tangga sering bertengkar. Dalam istilah primbon, watak ini disebut berlaku seperti matahari.',
    16 : 'Nilai neptu 16 hanya dimiliki oleh orang yang lahir di weton Sabtu Pon, Kamis Kliwon, dan Rabu Pahing. Orang dengan neptu ini bisanya memiliki watak lemah, jika berbicara banyak ma’afnya, sopan santun, apa yang diciptakannya terlaksana, jika sudah marah tidak ada yang dapat bisa menghalang-halangi. Dalam istilah primbon, watak ini disebut berlaku seperti air.',
    17 : 'Nilai neptu 17 hanya dimiliki oleh orang yang lahir di weton Sabtu Kliwon dan Kamis Pahing. Orang dengan neptu ini bisanya memiliki watak pendiam, mau bekerja tapi lambat, bila memberi nasehat sering dituruti, tidak mempunyai teman (sempit pergaulan). dan ia sering ditipu oleh orang lain. Dalam istilah primbon, watak ini disebut berlaku seperti bumi.',
    18 : 'Nilai neptu 18 hanya dimiliki oleh orang yang lahir di weton Sabtu Pahing. Orang dengan neptu ini bisanya memiliki watak panas, bicara baik periang dan bila bertengkar sangat bila berani, tetapi mudah mengalah. Dalam istilah primbon, watak ini disebut berlaku seperti api.'
}
hariWeton = {
    "Minggu Kliwon":"orang yang lahir dengan weton minggu kliwon memiliki sifat teguh terhadap pendirian, lurus pemikirannya , adil dalam pertimbangannya. didalam sebuah komunitas atau lingkungan menjadi orang yang terpandang sebagai orang yang lebih tua, walaupun usianya mungkin masih lebih muda dari pada yang lain karena sifat kedewasaannya tersebut. kejelekannya adalah: tidak mau mendahului pikiran (pendapat) maupun tindakannya oleh orang lain, sebab ia akan kecewa dan kesal hatinya sejak saat itu.",
    "Senin Legi":"apa bila seorang laki laki yang memiliki weton ini maka pikirannya pendek, hatinya kurang jujur namun jika seorang wanita tabiatnya tergolong pertengahan. dalam pergaulan hidup cukup akrab dengan teman kenalannya, seperti pada umumnya.",
    "Selasa Pahing":"jika laki laki ia tidak bersahaja pikirannya, banyak tingkah lakunya yang kurang baik jika ia perempuan maka memiliki sifat pada tutur katanya yang suka melampaui batas, berani terhadap lelaki/ suami dan juga hatinya kurang baik.",
    "Rabu Pon":"baik laki laki maupun wanita yang memiliki weton ini menjadi orang yang pemalu, mampu mencari rezeki sendiri-sendiri, apabila dalam rumah tangga yang kebetulan sama hari dan pasaran kelahirannya rabu pon maka sama – sama pandai mencari rezeki karena rajin dalam pekerjaanserta jujur dan bik hati.",
    "Kamis Wage":"orang yang lahir pada kamis wage otaknya selalu bekerja meski dalam diam sekalipun, baik merancang sesuatu ataupun menilai dan menimbang dengan seksama segala hal , apabila sekali saja mendengarkan suara , kata katanya dapat mengenai sasaran. crangnya cekatan dan tangkas dalam menghadapi kesulitan atau bahaya.",
    "jumat Kliwon":"apabila laki-laki, orangnya kurang suka berbicara bila dirasa tidak perlu benar. dalam pergaulan juga kurang lincah. apabila perempuan tutur dan sepak terjangnya bebas dan terlalu berani terhadap laki-laki.",
    "Sabtu Legi":"orangnya mudah sekali marah namun pandai mencari rezeki, berbakat untuk menjadi orang kaya apabila berkenaan dihatinya , sangat pemurah ia didalam memberikan kepada orang lain. cocok apabila memelihara kuda karena akan cepat kaya.",
    "Minggu Pahing":"orangnya cerdik, lincah dan tangkas. sayang sedikit memiliki rasa ke kakuan yang berlebihan sifatnya, seolah-olah ia menjadi tokoh yang sudah sempat menjelajahi dunia.",
    "Senin Pon":"lincah serta cekatan dalam mencari rezeki. pandai menyesuaikan diri dengan alam dan lingkungannya, pandai pula mengenakan hati orang . perkataannya halus dan menarik hati.",
    "Selasa Wage":"seseorang yang memiliki weton selasa wage tidak ramah baik dalam sikap maupun perkataannya , tidak suka mendengar nasehat serta tidak dapat menghargai budi kebaikan orang lain . jangankan niat untu menghargan malahan terkadang di balas dengan perbuatan yang buruk. namun apabila ia seorang perempuan memiliki sifat yang bagus yaitu baik, gemar menabung dan tingkah lakunya cukup serasi dalam pergaulan.",
    "Rabu Kliwon":"pikirannya hidup, lincah dan pandai menyesuaikan diri dalam pergaulan. sayang sekali terhadap perempuan/ istri hatinya kurang jujur. pada pertengahan umur biasanya apabila telah seringkali terbentur -bentur hidupnya , kemudian memilih hidup tenang bersemedi.",
    "Kamis Legi":"luas pikirannya tetapi tidak mau ditandingi. apalagi sampai jumpa orang yang melebihinya sikap ramah-tamahnya bisa mendadak lenyapberganti mendung meliputi wajahnya. jika ia seorang wanita wataknya tidak jujur, berani terhadap laki-laki/ suami.",
    "jumat Pahing":"rajin bekerja apabila sempat bersekolah tinggi (sampai menjadi orang pandai) banyak orang yang berguru kepadanya . sifat pendiam , jika di hinggapi sifat buruk, kejahatannya tak kepalang tanggung. bakat menjadi pengarang besar atau ahli nujum dan lain sebagainya ada padanya.",
    "Sabtu Pon":"rajin dalam segala pekerjaan yang menjadi beban kewajibannya, lincah dan tidak mau duduk diam. pada siang hari ada saja acara atau sesuatu yang dikerjakannya. apabila ia seorang wanita maka pintar dalam mencari rejeki dan lincah dalam bekerja namun juga memiliki sifat jelek yaitu kurang jujur hatinya.",
    "Minggu Wage":"besar kemauannya, sukar dihalangi kehendaknya artinya pendiriannya pantang dihalang karena akan diterjang dan di babat. wanita yang berkelahiran ini juga kurang jujur hatinya.",
    "senin Kliwon":"pendiam akan tetapi sekali bicara cukup mengandung arti dalam dan luas tutur cakapnya. bila kurang mendapat pendidikan baik bicaranya yang sangat langka itu mudah menimbulkan sakit hati atau mematahkan semangat orang. semasa muda tampaknya tumpul pikirannya, tetapi setelah meningkat usiannya, biasanya bangkit akal pikirannya, pandai dan halus budi pekertinya.",
    "Selasa Legi":"kurang lincah dalam pergaulan/ agak kaku. apabila banyak mendapat nasehat dari orang lain. teladan dan didikan baik besar harapan ia akan menjadi masyarakat banyak jasa pembelaannya dengan tenaga atau pikirannya. akalnya banyak, pikirannya jernih, hatinyapun baik tetapi apabila dihinggapi sikap masa bodoh segala sifat baik tersebut diatas tidak bakal terdapat bahkan ia menjdai seorang yang tidak disukai dalam pergaulan.",
    "Rabu Pahing":"cerdas, kuat daya pikirnya , tetapi tak suka melihat orang lain melebihi dirinya dan suka sekali pada pujian dan sanjungan.",
    "Kamis Pon":"pendiam, hemat dalam hidupnya, punya anggapan diri serba melebihi orang lain. terutama dalam soal kebersihan ( danandanan dan memelihara tubuh) maupun pekerjaan – pekerjaan lainnya.",
    "jumat Wage":"memili sifat seorang pandita atau orang berilmu tinggi. ada di miliki mereka yang lahir pada jum’at wage. lincah, ramah sikap tingkah maupun tutur bicaranya. banyak cakapnya tetapi serba dipertimbangkan baik buruknya terlebih dahulu. tegas dalam tindakannya walaupun kadang-kadang terlalu keras dan kejam terasanya bagi yang bersangkutan. dalam hal menolong ini tidak jarang pula menimbulkan kesulitan hidupnya sendiri.",
    "Sabtu Kliwon":"walaupun bodoh biasanya lebih suka berlagak pandai, orangnya pelupa dan kurang lincah gerak lakunya namun begitu ia seorang yang rajin dan jujru hatinya.",
    "Minggu Legi":"kurang berkembang akal pikirannya tetapi apabila sempat mendapat bimbingan dan pendidikan, dapat menonjol kepandaiannya, dibandingkan dengan orang yang ada disekitarnya. kejelekannya suka main permepuan dan tindakan-tindakan kurang baik lainnya.",
    "senin Pahing":"dalam pekerjaan ia kadang – kadang bersifat serakah ingin melakukan segala-galanya . akal pikirannya berkembang seperti lazim dan kebanyakan orang lain pada umumnya. wanita kelahiran senin pahing lebih banyak memiliki sifat-sifat baik dan kelebihan-kelebihan dari kaum pria.",
    "Selasa Pon":"sering mengambil keputusan/ tindakan terburu-buru, kurang dipertimbangkan sebelumnya(terlalu ceroboh) apabila menghadapi suatau masalahj yang besar. wanita yang memiliki weton selasa pon wataknya lebih baik juga berbakat menjadi istri ke 2 atau istri ke 3 dari orang yang berpangkat, kaya atau bangsawan.",
    "Rabu Wage":"cukup berkembang akal pikirannya, rajin menghadapi segala pekerjaan yang menjdai tugas kewajibannya. tetapi apabila wanita kelahiran ini terlalu berani terhadap lelaki atau suami.",
    "Kamis Kliwon":"akal pikirannyaa kurang berkembang, tetapi giat bekerja . wanita wataknya termasuk golongan sedang.",
    "jumat Legi":"bagaimanapun ia banting tulang mengusahakannya, sukarlah baginya menemukan buah pikiran sendiri didalam perjalanan hidupnya. apabila menghadapi kegagalan , biasanya sampai lama merenungkan tapi pikirannya buntu tidak bisa menemukan jalan keluar.",
    "Sabtu Pahing":"baik laki-laki maupun perempuan mempunyai kelincahan , kepandaian dalam mencari rizki, hemat dan suka menyimpan dalam sikap maupun tutur sapa dapat lembut dapat pula kasar.",
    "Minggu Pon":"mudah percaya pada tutur kata orang, mudah pula kena bujukan manis tanpa memikirkan akibat yang acap kali ternyata pahit dikemudian hari. wanita yang lahir pada minggu pon mempunyai sifat yang lebih baik, pandai menyimpan/ memanfaatkan segala hasil pendapatan sang suami.",
    "senin Wage":"kaku hati dan pendiriannya , keras kemauannya ( pantang mundur apabila memiliki niat) . sering melakukan tindakan- tindakan yang kurang dipertimbangkan sebelumnya, berani mati mati membela keyakinannya. wanita yang lahir pada weton ini bertabiat baik pada umumnya.",
    "Selasa Kliwon":"jika jahat tidak tanggung-tanggung. tetapi bila menjadi orang baik juga sampai menyerupai seorang dermawan atau ksatria yang pandai, suka menolong dan menasehati sesamanya juga ada bakat menjadi pujangga sastrawan atau pemimpin agama.",
    "Rabu Legi":"sederhana (bersahaja) , meminta mau memberipun rela. pikirannya adil, hatinya cerah. jika wanita cerdas dan manis budi.",
    "Kamis Pahing":"pendiam, jujur, hemat dan rajin bekerja . hidupnya mengutamakan keselarasan dan keserasian. apabila menjadi karyawan atau punya kedudukan , sangat dekat dengan atasan maupun pembesar-pembesar.",
    "jumat Pon":"akal pikirannya hidup, banyak ide-idenya yang baik. kejelekannya senang tampak pada wajahnya , tetapi bila tidak menyukai orang terang – terangan ia menyatakannya.",
    "Sabtu Wage":"memiliki sifat pelupa, namun rajin pula untuk mencobanya daya dan kemampuan pikiran untuk mengatasinya. hatinya kadang beku kaku bagaikan batu. mudah marah, tetapi cepat pula mereda kembali."
}
jodohTanggalLahir = [
    'Anda dan dia dapat membangun hubungan yang harmonis apabila kedua belah pihak bisa bekerjasama dengan baik serta bijaksana dalam menghadapi cobaan cinta yang datang silih berganti. Keberhasilan hubungan kalian sangat bergantung pada kehati-hatian anda dalam menjaga perasaan pasangan dari hal-hal yang mungkin dapat menyakiti hatinya. Pujilah ia saat pasangan berhasil melakukan hal-hal baik sebagai bentuk bahwa anda memiliki perhatian serta dorongan penuh terhadap apa pun yang sedang ia lakukan. Kalian berdua bisa menjadi pasangan yang serasi jika satu sama lain dapat saling menghargai.',
    'Lingkungan sosial yang menunjukkan adanya banyak lawan jenis di salah satu pasangan, misalnya lingkungan anda atau si dia bisa memicu kecemburuan ringan. Keterbukaan antara kedua belah pihak pasangan sangat diperlukan untuk memperkuat rasa saling percaya. Jangan membiasakan diri menyepelekan persoalan kecil karena sekecil apa pun sebuah persoalan tetap berpotensi untuk membuat hubungan berada dalam masalah yang lebih besar. Komunikasi adalah kunci sukses yang paling berperan penting dalam memberikan kontribusi keberlangsungan hubungan tetap berjalan dengan baik.',
    'Perbedaan pendapat dengan pasangan adalah hal yang wajar terjadi sehingga tidak perlu diperpanjang lagi karena hal itu justru akan berpotensi membuat masalah menjadi semakin rumit. Jangan berpikiran bahwa pasangan selalu menuntut sesuatu yang lebih karena sebenarnya ia hanya sedang berusaha membuat anda mau bertindak atau melakukan sesuatu dengan lebih serius. Dibalik semua tingkah serta sikapnya yang benar-benar membuat anda kesal, yakinlah bahwa sebenarnya ia adalah sosok pasangan yang sangat perhatian dan selalu menyayangi anda dengan sepenuh hatinya.',
    'Jika si dia memang bisa selalu membuat anda merasa bahagia dan nyaman menjalani hubungan, maka bukan hal yang tidak mungkin bahwa ia adalah jodoh yang diturunkan oleh Sang Pencipta untuk menemani hidup anda. Namun, jika pasangan anda saat ini justru kerap membuat hati anda merasa sedih dan gelisah, maka mungkin saja ia hanyalah bagian dari sepenggal kisah hidup yang harus anda lewati sedari menunggu hingga jodoh yang sesungguhnya datang kepada anda.',
    'Pasang surut hubungan anda merupakan bagian dari proses pendewasaan cinta. Jalani saja semua seperti air yang mengalir. Tidak perlu menengok masa lalu, hidup anda adalah tentang hari ini dan hari esok. Jangan mudah terpengaruh oleh orang lain karena hubungan anda sepenuhnya milik anda. Hubungan anda bersama si dia bisa menjadi lebih baik apabila satu sama lain tidak segan untuk mau lebih terbuka. Maka dari itu, mulai saat ini hindarilah kebiasaan menutup-nutupi sesuatu dari pasangan.',
]